Meet Kelli McCarty...a true, genuine, former Miss USA, and star of the NBC soap opera Passions.

But you can only spend so long pleasing your public, the networks, your lovers and other judges. Then it's time to please yourself.

And does she ever. Presenting &quot;Faithless&quot;, the ground-breaking, image-shattering feature from adult's most awarded director Paul Thomas... in which Kelli shocks every world she's ever been in, from network television to local beauty pageants to the pinnacle, Miss USA itself... and rocks your world at the very same time.

Beyond beautiful, beyond hot, beyond belief.
Kelli McCarty is Faithless.
